import React from 'react';
import UDPComponent from './Components/UDPComponent';

const App = () => {
  return (
    <div>
      <UDPComponent
        localPort={60001}
        proxyHost="127.0.0.1"
        proxyPort={60000}
        direction="source"
      />
      <UDPComponent
        localPort={60002}
        proxyHost="127.0.0.1"
        proxyPort={60000}
        direction="target"
      />
    </div>
  );
};

export default App;
